import React,{useState} from 'react'
import { Typography,TextField, Button } from '@material-ui/core';
import './Home.css';
const Home = () => {
    const [name,setName] = useState('');
    const [password, setPassword] = useState('');

    return (
        <div className='container'>
            <Typography variant='h3' color="primary" className='quote'>#getVaccinated</Typography>
            <Typography variant='h4' color="primary" className='instruction'>Please register accordingly if you are a customer or a seller</Typography>

            <div >
                    <form className='form'>
                    <H2>Log in / Sign in</H2>
                    <TextField name="name" className="input" variant="filled" label="Name"  color="primary" onChange={(e) => setName(e.target.value)}/>
                    <TextField name="email" className="input" variant="filled" label="Email"  onChange={(e) => setPassword(e.target.value)}/>
                    <Button type='submit' className="input" variant="contained" color="primary">Submit</Button>
                    </form>
            </div>
        </div>
    )
}

export default Home
